(162, 'Jucemappy', 'sprcli@rambler.ua', '81276535876', 'I need an offer for Domestic all over India', '<b>Многопрофильный центр медицины терапии и профилактики в Москве</b> \r\nМногопрофильная медицинская клиника терапии и профилактики в Москве \r\n \r\n \r\n<a href=http://www.consultant.ru/law/podborki/bolnichnyj_v_rabochij_den/><img src=\"https://i.ibb.co/L0vsDPt/96.jpg\"></a> \r\n \r\n \r\nПневмония – это инфекционное воспалительное заболевание тканей легких. Распространено и другое название болезни – воспаление легких. В настоящее время пневмония (воспаление легких) успешно лечится в подавляющем большинстве случаев. Для уверенности в благополучном исходе достаточно своевременно обратиться к врачу и строго следовать полученным рекомендациям. Однако не следует забывать, что пневмония по-прежнему остаётся грозным заболеванием, и при отсутствии надлежащего лечения способна привести к смерти больного. Чаще всего причиной пневмонии выступает бактериальная инфекция. В 30-40% случаев возбудителем воспаления легких является пневмококк (разновидной стрептококковой инфекции). Кроме бактерий, пневмония также может быть вызвана вирусами, микоплазмами, хламидиями. Обычно возбудитель попадает в легкие аэрогенным путем – с вдыхаемым воздухом. Но также возможно попадание инфекции с током крови из уже существующего очага воспаления (например, при перитоните). Проникновение инфекции через верхние дыхательные пути также в большинстве случаев происходит поступательно – сначала возникает очаг воспаления в носоглотке или горле, а уже потом из него инфекция «спускается» в легкие. Таким образом, любое вирусное заболевание верхних дыхательных путей (ОРВИ, грипп) может стать спусковым механизмом развития пневмонии, поскольку вирусное поражение создает благоприятные условия для активизации патогенных бактерий. При заболевании трахеитом или бронхитом необходимо обязательно наблюдаться у опытного врача, чтобы предотвратить или вовремя обнаружить проникновение инфекции в сами легкие. <a href=http://moscow.spravka-clinica.com/product/spravka-iz-psihonevrologicheskogo-dispansera/>ПНД диспансер справка медицинская для работы купить Москва</a> медсправка психоневрологического диспансера', '2023-10-08 22:07:50'),
